webpackJsonp([9430991909388],{2850:function(n,o){n.exports={pathContext:{docHtml:"<h1>CHANGELOG</h1>\n<h3>1.10.0</h3>\n<p><strong>2018/09/17</strong></p>\n<ul>\n<li>[#52] Add types field in package.json.</li>\n<li>[#46], [#49] Changes for splat when there are no tokens present and no splat present.</li>\n<li>[#47], [#53] Expose transpiled code for Browser-only scenarios.  </li>\n</ul>\n<h3>1.9.1</h3>\n<p><strong>2018/06/26</strong></p>\n<ul>\n<li>[#39] Don't break when there are % placeholders but no values.</li>\n<li>[#42] Only set <code>meta</code> when non-zero additional <code>SPLAT</code> arguments are\nprovided. (Fixes <a href=\"https://github.com/winstonjs/winston/issues/1358\">winstonjs/winston#1358</a>).</li>\n</ul>\n<h3>1.9.0</h3>\n<p><strong>2018/06/12</strong></p>\n<ul>\n<li>[#38] Migrate functionality from winston Logger to splat format.</li>\n<li>[#37] Match expectations from <code>winston@2.x</code> for padLevels. Create a correct <code>Cli</code> format with initial state. (Fixes [#36]).</li>\n</ul>\n<h3>1.8.0</h3>\n<p><strong>2018/06/11</strong></p>\n<ul>\n<li>[#35] Use <code>fast-safe-stringify</code> for perf and to support circular refs.</li>\n<li>[#34] Colorize level symbol.</li>\n</ul>\n<h3>1.7.0</h3>\n<p><strong>2018/05/24</strong></p>\n<ul>\n<li>[#28] Use more es6-features across the board.</li>\n<li>[#30] Fix combine return value.</li>\n<li>[#29] Add metadata function to format namespace.</li>\n</ul>\n<h3>1.6.0</h3>\n<p><strong>2018/04/25</strong></p>\n<ul>\n<li>[#25] Implement padLevels format.</li>\n<li>[#26] Update <code>dependencies</code> and add <code>node@10</code> to the travis build of the project.</li>\n<li>[#27] Refactor logform to use triple-beam.</li>\n</ul>\n<h3>1.5.0</h3>\n<p><strong>2018/04/22</strong></p>\n<ul>\n<li>[#23], (@ChrisAlderson) Add ms format to support '+N ms' format. Fixes #20.</li>\n<li>[#24], (@aneilbaboo) Fix <code>webpack</code> warnings.</li>\n<li>Add <code>.travis.yml</code>.</li>\n</ul>\n<h3>1.4.2</h3>\n<p><strong>2018/04/19</strong></p>\n<ul>\n<li>[#22], (@Jasu) Fix compilation on Babel 6.</li>\n</ul>\n<h3>1.4.1</h3>\n<p><strong>2018/04/06</strong></p>\n<ul>\n<li>[#21], (@dabh) Add tsconfig.json. Fixes #19.</li>\n</ul>\n<h3>1.4.0</h3>\n<p><strong>2018/03/23</strong></p>\n<ul>\n<li>[#14] @iamkirkbater Added Initial Metadata Support. </li>\n<li>Correct JSDoc for printf.js. Fixes #10.</li>\n</ul>\n<h3>1.3.0</h3>\n<p><strong>2018/03/16</strong></p>\n<ul>\n<li>[#18] Expose browser.js for rollup and the like. Fixes [#5].</li>\n<li>[#13] @dabh Use new version of colors.</li>\n<li>[#15] @dabh Add Typescript typings (ported from DefinitelyTyped).</li>\n<li>[#17], [#16] Fix error messages other typos.</li>\n</ul>\n<h3>1.2.2</h3>\n<p><strong>2017/12/05</strong></p>\n<ul>\n<li>[#4], [#11] Fix timestamp and replace <code>date-fns</code> with <code>fecha</code> (with test cases) [<code>@ChrisAlderson</code>].</li>\n</ul>\n<h3>1.2.1</h3>\n<p><strong>2017/10/01</strong></p>\n<ul>\n<li>[#3] Strip <code>info.splat</code> in <code>format.simple</code> to avoid double inclusion.</li>\n</ul>\n<h3>1.2.0</h3>\n<p><strong>2017/09/30</strong></p>\n<ul>\n<li>Transition from <code>info.raw</code> to <code>info[Symbol.for('message')]</code>.</li>\n<li>Finish <code>README.md</code> except for full list of all built-in formats.</li>\n<li>100% coverage for everything except for <code>{ align, cli, padLevels }</code>.</li>\n</ul>\n<h3>1.1.0</h3>\n<p><strong>2017/09/29</strong></p>\n<ul>\n<li>[#2] Add baseline expected formats that were previously exposed as options to <code>common.log</code> in <code>winston@2.x</code> and below.</li>\n<li>[#2] Introduce <code>format.combine</code> to remove inconsistency in behavior between <code>format(fn0)</code> and <code>format(fn0, ...moreFns)</code>.</li>\n<li>[#2] <code>README.md</code> now covers all of the basics for <code>logform</code>.</li>\n</ul>\n<h3>1.0.0</h3>\n<p><strong>2017/09/26</strong></p>\n<ul>\n<li>Initial release.</li>\n</ul>",docPath:"argo-ci/node_modules/logform/changelog",proj:"argo-ci"}}}});
